import SignIn from './component/signin/SignIn';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
      <Route path="/" element={<SignIn/>}>
        </Route>
      </Routes>
      </BrowserRouter>

  );
}

export default App;
